import React from "react";


// const Container = styled.div``

// const Wrapper = styled.div`
//     border:solid 40px
// `

// const Div = styled.div``

// const Img = styled.img``

// const Button = styled.button``

// const H2 = styled.h2``

// const P = styled.p``

// const H3 = styled.h3``

const singleProduct = (props) => {
    return (
            <div         className="swrapper">
                <div className="main1">
                    <div className="smallImg">
                        <img className="sideImg" src={props.img1} />
                        <img className="sideImg" src={props.img2} />
                        <img className="sideImg" src={props.img3} />
                        <img className="sideImg" src={props.img4} />
                        <img className="sideImg" src={props.img5} />
                    </div>
                    <div className="mainImg">
                        <div>
                            <img className="mainProduct" src={props.imgURL} />
                        </div>
                        <div className="btn-single">
                            <button className="btn btns">Buy Now</button>
                            <button className="cart-btn btn btns">Add to Cart</button>
                        </div>
                    </div>
                </div>
                <div className="main2">
                    <h2 className="productName">
                        {props.name}
                    </h2>
                    <p className="productDisc">{props.discription}</p>
                    <h3 className="productPrice">{props.email}</h3>
                </div>
            </div>
    );
}

export default singleProduct;
